VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 12, 'o date, confirmed that genetically predicted eGFR decline was associated with the development of PE. This is the first study combining large-scale observational analyses and MR that reveals the association between declined renal function and the occurrence of PE. 
Previously, studies have demonstrated high incidence of VTE in CKD or end-stage renal disease (ESRD) populations confirmed by MR analysis.
 
The mechanism under the relationship between renal insufficiency and PE contain several pathways: nephrotic syndrome is the most recognized condition of high risk of VTE, with clear mechanisms of the urinary loss of antithrombin and higher level of platelet activation. Moreover, studies showed endogenous anticoagulants such as antithrombin were lower than general population in patients with nephrotic syndrome.', '{0.584230899810791,0.3035390377044678,0.7120662927627563,-0.11954016983509064,0.5239709615707397,-0.2854069471359253,0.5187087655067444,0.13931752741336823,-1.0946590900421143,-0.9930828809738159,-0.29144299030303955,1.2416609525680542,-0.06406405568122864,0.06877857446670532,0.13807259500026703,0.2336452305316925,0.13771416246891022,-0.19796285033226013,1.0102918148040771,-0.37384483218193054,-0.4650988280773163,0.44747525453567505,-0.4596618115901947,0.09873751550912857,-0.6787998676300049,0.30554863810539246,-0.44556924700737,0.6687225699424744,-0.17850571870803833,-0.5618136525154114,0.14003309607505798,0.09033894538879395,0.49722951650619507,-0.8311203718185425,0.09107071906328201,-0.17337681353092194,-0.07093536108732224,0.40909630060195923,-0.6890132427215576,0.012161468155682087,0.3040512204170227,-0.22320705652236938,0.5728276968002319,-0.7017689347267151,0.24354775249958038,-0.6954349279403687,-0.43923354148864746,0.2738106846809387,-1.104841709136963,0.13760289549827576,-0.05319184809923172,-0.5378451943397522,0.14050887525081635,-0.4006037414073944,0.28991255164146423,0.016853639855980873,0.37059471011161804,0.6414759159088135,-0.8220219612121582,-0.3319881558418274,-0.3838024139404297,0.3275359570980072,-0.5467780828475952,-0.09761457145214081,0.3872922956943512,0.9976315498352051,0.7610912919044495,0.03413330763578415,-0.39573052525520325,-0.2784506678581238,-0.5804634690284729,-0.07826481759548187,-0.10679543763399124,0.11230707913637161,0.22340679168701172,-0.22174055874347687,-0.3929121494293213,0.25857898592948914,0.5869883298873901,0.3680