VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 13, 'gulants such as antithrombin were lower than general population in patients with nephrotic syndrome. However, inconsistent results were reported by another study using renal impaired population caused by various reasons, suggesting that loss of antithrombin might only exist in patients with damaged glomerular filtration barriers.
 
We innovatively quantify the decrease of eGFR that lower than 88 mL/min per 1.73 m
 
