VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 14, 'search for the first time uncovered the potential causal relationship between renal function and PE. Furthermore, the MR analyses employed genetic instruments of eGFR from the most recent and largest GWAS studies, and findings were reinforced by the consistent results observed using two independent sets of IVs and several analytical approaches for MR estimates. However, several limitations of the current study are necessary to be discussed. First, a major limitation of the MR design is horizontal pleiotropy. However, in this study, biases induced by pleiotropic effects are likely minimal. There was no indications of horizontal pleiotropy in the MR-Egger test and consistent results were drawn from several sensitivity analyses. Second, the results of the nested case–control study could be potentially biased since cases and controls came from two cohorts employing different technical specifications.', '{0.2726733684539795,-0.05542586371302605,0.4342235326766968,0.052600618451833725,0.14314629137516022,-0.5180806517601013,0.35940924286842346,-0.6059519052505493,-0.6215289831161499,-0.5083450078964233,-0.745281994342804,0.4669528603553772,0.44456541538238525,-0.07582508027553558,-0.3343089818954468,0.3346189856529236,0.28123539686203003,0.1029144823551178,0.5720555186271667,0.09777702391147614,-0.4368736147880554,0.07161659002304077,-0.35935232043266296,-0.1406230628490448,-0.34159356355667114,-0.16948626935482025,0.1555679440498352,0.6695789694786072,0.0691656768321991,-0.46289634704589844,0.5040444731712341,0.24133382737636566,0.16672104597091675,-1.6084554195404053,0.24199482798576355,0.19608767330646515,-0.6408512592315674,0.8371296525001526,0.1394432634115219,-0.46484383940696716,-0.012005574069917202,0.3530822694301605,0.3701647222042084,-1.0227056741714478,-0.1669933795928955,-0.09794536232948303,-0.44907400012016296,0.11945007741451263,-0.4585212767124176,0.3393813669681549,0.224693790078163