VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'Androgenetic alopecia, commonly referred to as male or female pattern hair loss, is a prevalent condition encountered in clinical practice. It is important to identify potential underlying causes and differentiate it from other forms of hair loss, which may require referral to a dermatologist for management. Pharmacological treatments for female pattern hair loss include minoxidil (topical and oral) and antiandrogens such as spironolactone. For male pattern hair loss, minoxidil and 5-alpha-reductase inhibitors (e.g. finasteride, dutasteride) can be used. Combination therapy is commonly employed, with clinical improvement typically requiring a minimum of 6 months. Supplements and other treatments have varying levels of evidence, and counselling is important to help patients make informed decisions about their management. Hair is deeply intertwined with a person’s identity.', '{0.49743714928627014,-0.14216390252113342,0.5900076627731323,-0.18838097155094147,-0.034409839659929276,0.7902637124061584,0.5982959270477295,0.15813040733337402,-0.2504132390022278,-0.7338077425956726,0.00893035065382719,0.995959460735321,0.18999570608139038,0.2130557745695114,0.3926287889480591,0.2673903703689575,0.29504066705703735,0.19550000131130219,-0.3683084547519684,-0.5645083785057068,-0.6155350804328918,0.9329157471656799,-0.09295355528593063,0.07736635953187943,-0.07915809005498886,-0.4555082321166992,-0.6596102714538574,0.12159910798072815,-0.34375816583633423,-0.642653226852417,-0.6226362586021423,-0.51929771900177,-0.15891055762767792,-0.08756852149963379,-0.1858311891555786,0.039381008595228195,0.3159209191799164,0.12192243337631226,0.03712885081768036,0.3241351842880249,-0.4725903570652008,-0.06792869418859482,-0.7044613361358643,0.044188663363456726,0.15044179558753967,0.671711266040802,0.024393241852521896,0.37850162386894226,0.7119865417480469,0.31353601813316345,0.27491477131843567,0.4804163873195648,-0.8