VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, 'ought to affect 80% of males by the age of 80. Both males and females with AGA report hair thinning. Female patients may report progressive hair shedding and loss of ponytail volume, and male patients may report hairline recession. A positive family history or a history of thyroid dysfunction may be present. There may also be an association with polycystic ovary syndrome. The causes of hair loss are diverse and varied, although the distribution of hair loss observed can provide clues about potential triggers. Severe psychological stress, systemic illness, endocrinological abnormalities, nutritional deficiencies, infections and malignancy can all contribute to hair loss, and a detailed history and thorough clinical examination can help differentiate potential causes. On examination, in female pattern hair loss, there is diffuse hair thinning with the temporal and occipital scalp usually preserved. Widening of the central part with frontal accentuation (i.e.', '{0.25665363669395447,-0.549541711807251,0.8113696575164795,-0.6101151704788208,-0.003932170104235411,0.5545780062675476,0.7528206706047058,-0.09052614867687225,-0.163581982254982,-0.20858503878116608,0.05129367485642433,1.275185227394104,0.031079061329364777,0.21029263734817505,0.14503446221351624,0.16475139558315277,0.33995887637138367,-0.09687267988920212,-0.20606005191802979,-0.8649303913116455,-0.33623698353767395,0.8534541726112366,0.3371300995349884,0.3844556510448456,-0.08091547340154648,-0.36481741070747375,-0.49803581833839417,0.2116532027721405,-0.10306693613529205,-0.051043037325143814,-0.9531919360160828,-0.6748350262641907,-0.00857604667544365,-0.22678136825561523,0.10205890238285065,0.31869351863861084,0.4598175287246704,0.07501944899559021,0.27296191453933716,-0.030206425115466118,-0.5336270928382874,-0.42831841111183167,-0.3071986734867096,-0.05931023880839348,-0.04588798061013222,0.991214394569397,0.26868754625320435,0.0779