VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 3, 'and occipital scalp usually preserved. Widening of the central part with frontal accentuation (i.e. Christmas tree pattern) may be noted. In male pattern hair loss, there is usually bitemporal hairline recession with or without scalp vertex hair loss. Commonly used classification scales include the Norwood–Hamilton scale for male pattern hair loss, and the Ludwig scale and Sinclair scale for female pattern hair loss. The hair pull test and dermoscopy of the scalp (also known as trichoscopy) can assist in the clinical diagnosis of AGA. The hair pull test involves holding approximately 60 hairs between the index finger and thumb and pulling these hairs away from the vertex, parietal and occipital areas of the scalp. A positive hair pull test is defined when more than 2 hairs are removed from the scalp. Trichoscopy of AGA demonstrates miniaturised hairs, with a reduction of hairs per follicular unit; the follicular openings (ostia) are preserved.', '{0.6273199319839478,-0.23325495421886444,0.4088144600391388,-0.46084532141685486,0.13850882649421692,0.29941102862358093,0.5376401543617249,-0.40341806411743164,-0.12347040325403214,-0.26887911558151245,0.05912027508020401,0.4837000072002411,0.11935952305793762,0.3007321357727051,-0.07606903463602066,0.2409774512052536,0.25652235746383667,0.22299721837043762,-0.0706956684589386,-0.9128586649894714,-0.24548448622226715,0.5239417552947998,0.4752911925315857,0.3018013536930084,0.143591046333313,-0.34986230731010437,-0.30726686120033264,0.24199363589286804,0.031762655824422836,0.27431392669677734,-0.8539878129959106,-1.1793254613876343,0.008915828540921211,-0.2871037721633911,-0.013765576295554638,0.019023289903998375,0.0672772079706192,0.08575974404811859,0.5283298492431641,0.2706168591976166,-0.02536308392882347,-0.6891046166419983,-0.48102331161499023,-0.2885074317455292,0.167875275015831,0.6003265976905823,0.2570377588272095,-0.14144600927829742,0.95545