VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 4, 'hairs, with a reduction of hairs per follicular unit; the follicular openings (ostia) are preserved. Scalp biopsies are not routinely performed; however, they may be used if there is diagnostic uncertainty. There are multiple differentials for AGA. For example, telogen effluvium presents as abrupt hair loss following pregnancy or a severe psychological or physical stressor. The hair pull test is positive and empty follicles may be seen on trichoscopy. Alopecia areata presents as well-circumscribed patches of hair loss in adults or children; trichoscopy may reveal black dots and exclamation mark hairs. AGA can present simultaneously with other forms of hair loss, such as telogen effluvium. Referral to resources such as DermNet for photographs can aid in the diagnosis. Symptoms such as scalp pain, itch or burning, extensive hair loss, or rapid hair loss in the absence of a preceding trigger, warrant urgent escalation of care to a dermatologist.', '{0.26901888847351074,-0.4355924129486084,0.43469884991645813,-0.6539344191551208,0.17162373661994934,0.2325252890586853,0.5436667203903198,-0.21299786865711212,-0.39119333028793335,-0.2626280188560486,-0.07463182508945465,0.9268556237220764,0.08767879754304886,0.15691787004470825,0.08746311068534851,0.18989212810993195,0.16201728582382202,-0.20903471112251282,-0.14134708046913147,-0.9023101925849915,-0.5957362651824951,0.6833385229110718,0.2059340626001358,0.4012705087661743,-0.00955856405198574,-0.4696541726589203,-0.7306458353996277,-0.004288969095796347,0.15648353099822998,0.057517606765031815,-1.047588586807251,-0.5520424842834473,0.09392967075109482,-0.33365529775619507,0.1448213756084442,0.37769392132759094,-0.019895698875188828,-0.03470674902200699,-0.19971863925457,0.1987144947052002,-0.28959596157073975,-0.06315770000219345,-0.6961869597434998,0.013444977812469006,0.07038211077451706,1.013452172279358,0.27090176939964294,0.09880904853343964,0.76