VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 5, 'ir loss in the absence of a preceding trigger, warrant urgent escalation of care to a dermatologist. It is important that the primary care physician is able to identify scarring alopecias to allow early referral to a dermatologist for treatment, as these can lead to permanent hair loss. If hormonal abnormalities are suspected that cannot be managed in the primary care setting, general practitioners (GPs) may consider the involvement of an endocrinologist to optimise patient management. As hair loss affects a person’s physical appearance, it is important that patients are counselled appropriately about treatment expectations, including the risks and benefits of treatments, so that they can make informed decisions about their management. In most cases, treatments are not curative and are designed to slow progression of hair loss and stimulate hair growth.', '{0.5109232664108276,-0.42949002981185913,0.4239198863506317,-0.8720254302024841,-0.3750394284725189,0.8583622574806213,0.5856695175170898,-0.03562316671013832,-0.2999941408634186,-0.12207642942667007,-0.013277353718876839,0.8547331690788269,-0.25614890456199646,-0.150484099984169,0.3057621121406555,0.08703073114156723,-0.46852365136146545,-0.16455905139446259,-0.30213823914527893,-0.40280210971832275,-0.5344964265823364,0.5033140778541565,-0.10587000101804733,0.12458022683858871,-0.31277015805244446,-0.7028688192367554,-0.6246300339698792,-0.3498193025588989,0.16682018339633942,-0.3466711640357971,-0.8607873916625977,-0.3639521598815918,-0.30756860971450806,0.04337846860289574,-0.349161297082901,-0.05356121063232422,0.4111861288547516,0.30037081241607666,-0.41159921884536743,0.09670599550008774,-0.4288133382797241,0.2634122669696808,-0.7503921389579773,-0.12177873402833939,-0.0313885323703289,0.6795130372047424,-0.003134096972644329,-0.025676079094409943,0.8191343545913696,-0.0326264426112175,0.019204052165150642,0.004518334753811359,-0.693972