VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 6, 'tments are not curative and are designed to slow progression of hair loss and stimulate hair growth. Concurrent conditions such as tinea capitis or seborrhoeic dermatitis must be addressed, and nutritional deficiencies such as iron deficiency, or metabolic disorders such as thyroid dysfunction, must be treated prior to starting treatment for hair loss. Most pharmacological treatments take at least 6 months to show a response and may need to be continued long term. Referral to dermatologists may then be considered if there is no response to treatment after 6 months. Serial photography can assist with monitoring response to treatment. Nonpharmacological management should be encouraged, and this includes the use of healthy hair care practices, creative hair styling and the use of cosmetic camouflage (e.g. natural keratin fibres).', '{0.20005589723587036,0.08712529391050339,0.38623544573783875,-0.6848268508911133,-0.07497665286064148,0.1407182365655899,0.10881921648979187,0.13385415077209473,-0.2679850459098816,-0.516366183757782,-0.1344592124223709,0.8507463932037354,0.14575083553791046,0.12994550168514252,0.3205113410949707,0.3728550970554352,0.6118277311325073,-0.4498773515224457,-0.13388410210609436,-0.5445999503135681,-0.8802046775817871,0.36840659379959106,-0.23538899421691895,-0.27577459812164307,0.6317862868309021,-0.473284512758255,-0.2728341817855835,-0.005430316086858511,0.23399220407009125,-0.04770831763744354,-0.7927289009094238,-0.1824805736541748,0.027968671172857285,0.5933598875999451,-0.32683008909225464,0.10052124410867691,-0.2060561627149582,0.40728360414505005,0.10629728436470032,-0.5620032548904419,-0.3182196617126465,-0.00041796406731009483,-0.9996936917304993,0.027264583855867386,-0.4917565584182739,0.6998493075370789,0.07672649621963501,-0.07005366683006287,0.5905368328094482,-0.03395375609397888,0.06891139596700668,0.01240825466811657,-0.5281721949577332,-0.2586100399494171,