VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 7, 'e practices, creative hair styling and the use of cosmetic camouflage (e.g. natural keratin fibres). Pharmacological treatments may stimulate hair growth and/or prevent further hair loss ( NB1: Dutasteride is approved by the Therapeutic Goods Administration (Australia) for the treatment of benign prostatic hyperplasia. Combination therapy (e.g. with antiandrogens) is more effective than monotherapy at minimising hair loss and may be considered for those with moderate to severe AGA. In female pattern hair loss, antiandrogen therapy may be considered particularly in those with signs of hyperandrogenism (e.g. hirsutism, acne). For  topical minoxidil (2 to 5%) with oral spironolactone 25 to 50 mg oral minoxidil (compounded into 0.25 mg tablets) with oral spironolactone 25 to 50 mg sublingual or oral minoxidil 0.25 to 1 mg with oral spironolactone 25 to 50 mg and oral finasteride 1 mg in postmenopausal women.', '{0.18822307884693146,0.20060330629348755,0.46024489402770996,0.08527390658855438,-0.10646979510784149,0.6594594120979309,-0.03803494572639465,0.5578765869140625,0.4733790159225464,-0.8486720323562622,0.03508581221103668,0.31172245740890503,0.24142085015773773,-0.18137405812740326,0.3790849447250366,0.061237797141075134,0.11361018568277359,0.02257355861365795,0.11770855635404587,-0.22193671762943268,-0.5526898503303528,0.3740333020687103,-0.38770654797554016,-0.30407506227493286,0.07350869476795197,-0.23155105113983154,-0.1178160011768341,-0.10467303544282913,0.12378954887390137,-0.5352962613105774,-0.552838921546936,-0.28523826599121094,-0.10483892261981964,0.34675803780555725,-0.05763521045446396,-0.23824657499790192,-0.007331548258662224,0.07344695925712585,-0.07120072841644287,-0.33577996492385864,-0.21987737715244293,0.13884130120277405,-0.7852697968482971,0.19026057422161102,-0.47168225049972534,-0.050426457077264786,-0.2014009952545166,-0.0019143770914524794,0.4885123670101166,0.3942308