VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 10, 'ults, particularly biotin. There are several other treatment options that all have limited evidence. Mesotherapy involves the intradermal injection of therapeutic agents and bioactive substances. The use of platelet-rich plasma has been proposed for many dermatological disorders given its anti-inflammatory and regenerative properties through angiogenesis, cell differentiation and proliferation. Low-level laser therapy devices emit low-power coherent monochromatic red light that has been shown to promote hair growth as a result of increased blood flow to the hair follicle. Patients in whom medical therapy has failed may consider surgical management, which involves hair transplantation and results in permanent hair restoration. Treatment of AGA involves a multipronged approach, where medical treatments are personalised to the patient, considering goals, cost and comorbidities.', '{0.31171315908432007,-0.07236603647470474,0.25720831751823425,-0.8034920692443848,0.3161635398864746,0.19894857704639435,0.18188025057315826,-0.010237492620944977,-0.21869663894176483,-0.32698550820350647,-0.13240565359592438,-0.04757820814847946,0.09689585864543915,-0.30106568336486816,0.4047551155090332,0.15927326679229736,-0.19658997654914856,-0.17269636690616608,-0.026926875114440918,-0.5908147692680359,-0.4462474584579468,0.5886432528495789,-0.07321812957525253,0.1445699781179428,0.2825789153575897,-0.3947441577911377,-0.8138480186462402,0.2102656364440918,0.5650153756141663,-0.48876896500587463,-0.46276262402534485,-0.11067980527877808,-0.1716848462820053,0.27674397826194763,-0.09725706279277802,-0.12060943245887756,-0.3456176817417145,0.21074624359607697,-0.13077184557914734,0.40174031257629395,-0.4729330241680145,0.5576414465904236,-0.7015900015830994,-0.24254296720027924,-0.3044966161251068,-0.10905682295560837,-0.053235720843076706,-0.04376158490777016,0.8841545581817627,0.6931531429290771,0.3639938533306122,-0