VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'Glioblastoma is an aggressive brain cancer with a 5-year survival rate of 5–10%. Current therapeutic options are limited, due in part to drug exclusion by the blood–brain barrier, restricting access of targeted drugs to the tumor. The receptor for the type 1 insulin-like growth factor (IGF-1R) was identified as a therapeutic target in glioblastoma. We previously reported that the intracerebral growth of glioma cells with reduced IGF-1R levels was inhibited. The objectives of this study were to evaluate the sensitivity of glioma cells to a novel IGF-axis inhibitor, the IGF-Trap, and optimize its delivery to the brain. We tested the effect of the IGF-Trap on the growth of the human glioma stem cells MES-1123 and U87 MG cells, and of murine GL261 cells in vivo, using subcutaneous and orthotopic implantation.', '{0.401925265789032,-0.45268818736076355,-0.5760403275489807,-0.48136767745018005,0.6436612010002136,0.2759912312030792,0.6319441199302673,-0.5970554351806641,-0.07979091256856918,0.6719343066215515,0.41024497151374817,-0.7029487490653992,-0.3658551573753357,-0.63667893409729,0.18041059374809265,-0.41454049944877625,-0.11980675160884857,1.0396006107330322,0.08067338168621063,0.5050483345985413,-0.08040182292461395,0.18427535891532898,0.05040939524769783,0.25514355301856995,-0.47730931639671326,0.5491622090339661,-0.5135876536369324,0.1068272814154625,0.07501773536205292,-0.17884773015975952,-0.5672093033790588,0.36664628982543945,1.025416612625122,0.5198261141777039,-0.028279393911361694,0.8256548643112183,-0.29703977704048157,-0.21669550240039825,0.8131768107414246,-0.24967175722122192,1.0265672206878662,0.23092511296272278,-0.5655925273895264,-0.5626606941223145,0.4674849510192871,-0.012625020928680897,0.07211774587631226,-0.5630274415016174,0.7579957842826843,-0.32306209206581116,-0.16169939935207367,-0.16347351670265198,0.6483446359634399,0.5420069694519043,0.9218918085098267,-0.176753535