VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 1, 'and U87 MG cells, and of murine GL261 cells in vivo, using subcutaneous and orthotopic implantation. We show that the growth of glioma cells implanted subcutaneously or orthotopically in the brain was inhibited by systemic and direct intracerebral administration of IGF-Trap, respectively, resulting in increased survival. To increase the efficiency of systemic delivery to the brain, we encapsulated the IGF-Trap in trimethyl chitosan (TRIOZAN™) nanoparticles prior to intravenous injection. We found that nanoparticle encapsulation increased the uptake and retention of the IGF-Trap in the brain and resulted in an improved therapeutic effect against intra-cerebrally growing tumors. Our results identify the IGF-Trap as a potent inhibitor of intracerebral glioma growth and show that encapsulation in nanoparticles can improve delivery of biologics such as the IGF-Trap to the brain, thereby enhancing the therapeutic response.', '{0.1973060667514801,-0.27313947677612305,-1.0238200426101685,-0.406697541475296,0.3674745261669159,0.13432060182094574,0.1910749226808548,-0.60633385181427,-0.4287952184677124,0.6864579319953918,0.20958876609802246,-0.7721682786941528,0.08632251620292664,-0.7409355640411377,-0.18916106224060059,-0.41646891832351685,-0.03885288164019585,0.46462684869766235,0.0075506772845983505,0.537771999835968,-0.4641880989074707,0.4493550658226013,0.011496813967823982,0.27523404359817505,-0.13543389737606049,0.8613904714584351,-0.3282533884048462,0.21758320927619934,0.32064905762672424,-0.576389729976654,-0.5726761221885681,0.6233834028244019,0.4236890375614166,0.4247014820575714,0.12371303886175156,0.87037593126297,0.04846944659948349,0.050346530973911285,1.046235203742981,-0.10808636993169785,0.09355270117521286,0.3989071846008301,-0.49189943075180054,-0.6490221619606018,0.5417182445526123,0.0868249163031578,0.11233488470315933,-0.5626834034919739,0.672185480594635,-0.6291599869728088,-0.0635