VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, 'delivery of biologics such as the IGF-Trap to the brain, thereby enhancing the therapeutic response. Glioma cells growing in the brain were sensitive to treatment with the IGF-Trap. Encapsulation in TRIOZAN nanoparticles increased brain levels of systemically administered IGF-Trap, inhibited glioma growth, and increased survival. The clinical management of glioma has been hampered by limited access of targeted biologics to the tumor site, due to exclusion by the blood–brain barrier (BBB). Effective treatment of glioma, therefore, faces the double challenge of identifying drugs that target specific drivers of glioma growth in vivo and successfully delivering those inhibitors to the tumor site to curtail its growth. In the present study, we aimed to address both of these challenges. Our results identify blockade of the IGF-axis as an effective therapeutic strategy to inhibit intracerebral glioma growth.', '{0.5948842167854309,-0.25130128860473633,-0.2861073911190033,-0.5401374697685242,0.40301740169525146,-0.11787264049053192,0.16279977560043335,-0.030416561290621758,-0.3027489185333252,0.9096959829330444,0.01630837470293045,-0.5957163572311401,-0.2563072443008423,-0.6702433824539185,0.11470025032758713,-0.5719228982925415,-0.20249255001544952,0.5721453428268433,-0.09863061457872391,0.15872395038604736,-0.47157323360443115,0.26952093839645386,-0.27345094084739685,0.023981530219316483,-0.3011285364627838,0.2776044011116028,-0.2721056342124939,-0.029954606667160988,0.22319257259368896,-0.1889626532793045,-0.5530568361282349,0.16787734627723694,0.5149880051612854,0.388764351606369,0.16888642311096191,0.8390679359436035,-0.11082018166780472,0.4595860242843628,0.7736656665802002,-0.5206034779548645,0.8731142282485962,0.1058470755815506,-0.4922957122325897,-0.6607610583305359,0.5093857049942017,-0.3606027662754059,0.1861446052789688,-0.8144100308418274,0.9071340560913086,-0.2119285613298416,0.0976901873