VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 3, 'lockade of the IGF-axis as an effective therapeutic strategy to inhibit intracerebral glioma growth. They also show that encapsulation of this biologic in TRIOZAN, a trimethyl chitosan-based nanoparticle, increased the efficiency of its systemic delivery to the brain and enhanced its therapeutic effect in an orthotopic murine glioma model. These results have translational implications for the treatment of glioma but may also be more broadly relevant for the management of other brain tumors, including brain metastases from other primary malignancies. Glioblastoma multiforme (GBM) is the most prevalent primary brain tumor in adults. Glioblastoma occurs at higher rates in persons older than 55 years of age and the 5-year survival rate for GBM patients is a dismal 5–10%. The ligands, insulin-like growth factors (IGF-1 and IGF-2) are involved in cell growth and differentiation.', '{0.31677794456481934,-0.36649462580680847,-0.4064638018608093,-0.45744577050209045,0.19791372120380402,-0.484267920255661,0.14130787551403046,-0.15479609370231628,-1.0623985528945923,0.46051260828971863,0.04670041427016258,-0.4327760934829712,0.07694343477487564,-0.38572606444358826,-0.3981190025806427,-0.29865026473999023,0.7447186708450317,0.5986347198486328,0.09010939300060272,0.25013813376426697,-0.5568816661834717,0.06651072204113007,-0.039497748017311096,-0.06855713576078415,-0.314834326505661,0.2945336401462555,-0.34520143270492554,-0.10040419548749924,0.014477012678980827,-0.07388795167207718,-0.5740655064582825,-0.054788872599601746,0.5703263878822327,0.4810868799686432,-0.10286791622638702,0.6481603980064392,-0.19865782558918,0.3414664566516876,0.8069477677345276,-0.44664740562438965,0.7872130274772644,0.30904096364974976,-0.6797000765800476,-0.24801947176456451,-0.20057335495948792,-0.17526651918888092,0.01957600936293602,-0.44492489099502563,0.5355595350265503,-0.27046626806259155,0.10691794008016586,-0.11840849