VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 4, 'ands, insulin-like growth factors (IGF-1 and IGF-2) are involved in cell growth and differentiation. Ligand binding triggers IGF-1R signaling via the PI3K/Akt and MEK/ERK pathways and nuclear IGF-1R transport to activate gene transcription, thereby regulating resistance to apoptosis, cell proliferation, and cell cycle progression and promoting tumor growth. We previously reported on the bioengineering of a potent IGF-1R signaling inhibitor, the IGF-Trap—a fusion protein consisting of the entire extracellular domain of the human IGF-1R fused to the Fc domain of human IgG One major challenge to successful treatment of GBM and other brain malignancies is effective drug delivery to the brain, as drug exclusion by the blood–brain barrier (BBB) limits drug access to the tumor. The BBB is a semi-permeable layer of specialized endothelial cells as well as astrocytic end-feet processes and basement membrane that protect the brain from foreign and potentially harmful substances.', '{0.20661287009716034,-0.40010395646095276,-0.14925241470336914,-0.7441514134407043,0.8094754219055176,0.18396182358264923,0.4144498407840729,0.16277949512004852,-0.058655742555856705,0.46875396370887756,0.444612056016922,-0.5427117943763733,-0.12128712981939316,-0.538484513759613,-0.36111947894096375,-0.42456158995628357,-0.614645779132843,0.6895623207092285,0.25471583008766174,0.46844586730003357,0.029892059043049812,0.3306632936000824,-0.21890728175640106,0.17952744662761688,-0.3397580683231354,0.5106139779090881,-0.354545921087265,-0.409064918756485,0.31271037459373474,0.21720217168331146,-0.6233453750610352,0.04896826669573784,0.4200109541416168,0.9331824779510498,0.17293129861354828,0.9592071175575256,-0.14422500133514404,0.051330145448446274,0.22077403962612152,-0.30661776661872864,0.8154168725013733,-0.34069278836250305,-0.24003995954990387,-0.6640985012054443,0.17852039635181427,-0.2612140476703644,0.46482181549072266,-