VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 11, 'Meier survival curves. We began by evaluating the effect of the IGF-Trap on glioma growth in vitro. GL261 and U87 MG cells were selected for this study because they are highly aggressive in vivo and recapitulate GBM phenotypes and drug responses. The IGF-Trap inhibits IGF-1 induced glioma growth in vitro. U87MG (A) and GL261 (B) cells were cultured in low (1%) FBS medium supplemented on day 0 with 10 ng/ml IGF-1 and with and without IGF-Trap that was added at 1:1 or 1:2 (IGF-1: IGF-Trap) molar ratio. Cell Proliferation was measured using the MTT assay. Results are expressed as means (± SD) fold change in OD (570 nm) relative to time 0 ( To evaluate the therapeutic effect of IGF-Trap in vivo, we began with a subcutaneous (s.c.) tumor model where tumor growth can be more directly measured. Syngeneic C57Bl/6 and NSG male mice were inoculated s.c. with 10 The IGF-Trap inhibits the growth of subcutaneously injected glioma cells.', '{0.11114394664764404,-0.5440212488174438,-0.9584947228431702,-0.7214419841766357,0.37092357873916626,0.39338812232017517,0.3465132713317871,-0.5499184131622314,-0.14505276083946228,0.26630520820617676,0.40392765402793884,-0.7132823467254639,-0.5523990988731384,-0.5363284945487976,-0.02862786129117012,-0.3312651515007019,0.03190038353204727,0.8250210285186768,0.15416784584522247,0.6906828880310059,-0.008101677522063255,0.17205879092216492,-0.3459053635597229,0.30347031354904175,-0.3206879198551178,0.5022191405296326,-0.6572118401527405,0.3147893249988556,0.21384496986865997,-0.3099326193332672,-0.6110904216766357,0.6765540838241577,0.79349285364151,0.3784521222114563,0.14722184836864471,0.5880688428878784,-0.5743197202682495,-0.20735567808151245,1.3394520282745361,-0.06510576605796814,1.1424193382263184,0.436012327671051,-0.7594054341316223,-0.6861523985862732,0.460316002368927,0.5321077704429626,0.03302305191755295,-0.7968791723251343,0.7823166251182556,-0.368810296058654