VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 12, 're inoculated s.c. with 10 The IGF-Trap inhibits the growth of subcutaneously injected glioma cells. GL261 cells (B and C) and U87MG (D and E) cells (10 Having established the sensitivity of the tumor cells to IGF-Trap treatment in vitro and in vivo, we next sought to determine whether their growth in the brain could also be blocked by the IGF-Trap. To overcome the likely exclusion of circulating IGF-Trap from the brain by the BBB, we administered the IGF-Trap directly into the brain via a cannula implanted intracerebrally. GL261 cells expressing the luciferase gene were injected orthotopically into the brain (10 IGF-Trap administered intra-cerebrally inhibits the growth of orthotopically implanted glioma cells. Luciferase tagged GL261 (10 We confirmed the inhibitory effect of IGF-Trap using GBM stem cell (GSC) xenografts growing in NSG mice. Mice were injected orthotopically with the very aggressive human glioma stem cells (GSC) MES-1123 and treated as described above.', '{0.16601425409317017,-0.21699745953083038,-0.8599967956542969,-0.4901568293571472,0.23761990666389465,0.2476031482219696,0.14035221934318542,-0.6982998251914978,-0.5864588022232056,0.2703741788864136,0.13518942892551422,-0.5781930088996887,-0.1613379567861557,-0.42250245809555054,-0.41026750206947327,-0.36184847354888916,0.039387546479701996,0.7728602886199951,0.0028795748949050903,0.6180311441421509,-0.14890630543231964,0.18030983209609985,-0.12175789475440979,0.2615208029747009,-0.3185170292854309,0.5634066462516785,-0.32413890957832336,0.40291523933410645,0.010452897287905216,-0.23438496887683868,-0.705111026763916,0.5433270931243896,0.6734297871589661,0.9287238717079163,0.08490341901779175,0.8806477785110474,-0.38008734583854675,0.02872456982731819,0.863598644733429,-0.22880777716636658,0.749924898147583,0.28696057200431824,-0.9329738616943359,-0.4469599425792694,0.37979379296302795,0.40472611784935,0.05290691927075386,-0