VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 14, 'anoparticle (NP)-based delivery approach for increased IGF-Trap delivery and retention in the brain. Nanocarriers have the added advantage of decreasing drug uptake and opsonization by the mononuclear phagocytic system (MPS). TRIOZAN™, is a polymeric nanocarrier that enables the encapsulation and protection of targeted drugs (small molecules and biologics) and was shown to improve drug delivery across the BBB. IGF-Trap encapsulation in trimethyl chitosan nanoparticles increases the uptake, stability and intra-vascular levels of the IGF-Trap in the brain. IGF-Trap was labeled with the CF680 dye and encapsulated in TRIOZAN™ nanoparticles (NP-Trap). NP-Trap and the free IGF-Trap were injected intravenously, and the biodistribution was monitored over 24 h using optical imaging.', '{-0.30794385075569153,-0.5502974390983582,-1.344352126121521,-0.06544050574302673,0.0707600936293602,0.20451359450817108,-0.17959757149219513,0.3385857045650482,-0.5610693693161011,0.21840620040893555,0.05316998064517975,-0.8394057750701904,-0.008354641497135162,-0.8677594661712646,-0.2651669383049011,-0.9748249053955078,-1.0014686584472656,0.20593787729740143,0.07093602418899536,0.6372066736221313,-0.44564545154571533,0.6408752799034119,-0.279760479927063,-0.17716535925865173,-0.11292655766010284,0.6243161559104919,-0.19922678172588348,-0.06918038427829742,0.8507596254348755,-0.434404194355011,-0.8399834632873535,0.24738375842571259,-0.26185816526412964,0.7654550671577454,-0.14609530568122864,0.24478048086166382,0.386870801448822,0.6176602244377136,0.35809755325317383,-0.26376697421073914,-0.0579519085586071,0.18204472959041595,-0.5303245186805725,-0.1774093359708786,0.050947368144989014,0.47260475158691406,0.32059335708618164,-0.1660269945859909,0.38556379079818726,-0.33052459359169006,-0.20739422738552094,-0.33032798767089844,-0.006913559045642614,-0.06096440553665161,0.35176780819892883,-0.25504839420318604,0.28912213