VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 18, 'ing the BBB to increase drug access to the brain for the treatment of primary and metastatic tumors. Here we show that the intracerebral growth of aggressive human gliomas and patient-derived glioma stem cells could be inhibited by the direct intracranial administration of the IGF-Trap, consistent with the documented role of the IGF- axis in glioma progression. Of note are our results with MES-1123—the highly aggressive patient-derived glioma stem cells. We found a modest (but significant) increase in the survival of mice injected orthotopically with these cells, when treated with the IGF-Trap. In view of their rapid growth, whereby all control mice were at humane end point by 12 days post injection, our results suggest that targeting the IGF-axis may be clinically beneficial, particularly if enough of the drug can reach the tumor site.', '{0.4432452917098999,-0.03181929141283035,-0.28978797793388367,-0.8374626636505127,0.3287838101387024,0.10828834027051926,0.07044153660535812,-0.49403703212738037,-0.5232524871826172,0.5841181874275208,0.06445945054292679,-0.5430546998977661,-0.2380724549293518,-0.4172693192958832,-0.17426547408103943,-0.2773943841457367,-0.08437903225421906,0.8461263179779053,-0.06469622254371643,0.43212613463401794,-0.2940866947174072,-0.01757282204926014,0.030748680233955383,0.17475539445877075,-0.2959339916706085,0.11338475346565247,-0.3747921586036682,0.13848695158958435,-0.06351383775472641,-0.10966701805591583,-0.7473775148391724,0.21046587824821472,0.8883124589920044,0.44615450501441956,0.07211222499608994,0.8738499879837036,-0.38339895009994507,0.09044598042964935,0.7884765863418579,-0.635807991027832,0.864776074886322,0.2767767012119293,-0.6217170357704163,-0.38964053988456726,0.5273494720458984,-0.1075863465666771,-0.27974650263786316,-0.8654929399490356,0.9232347011566162,-0.035896968096494675,-0.12976227700710297,-0.14186851680278778,0.160994753241539,0.9232245683