VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 21, 'ty in prevention of tumor recurrence. Furthermore, in this study, we used IGF-Trap as a monotherapy. In the clinical setting, given the aggressive nature of this disease, IGF-Trap is likely to be most effective when combined with other modalities such as surgery, chemotherapy, and radiation. In those settings, when tumor volume is reduced and its outgrowth is inhibited by additional treatment regimens, pretreatment with IGF-Trap or long-term sustained treatment may not be required to achieve optimal disease management. Other studies have also documented increased drug delivery and potency when the target agents were encapsulated in trimethyl chitosan-based formulations. For example, trimethyl chitosan-encapsulated retinoic acid was used to treat glioblastoma cells in vitro and this resulted in increased cytotoxicity, apoptosis, and necrosis.', '{-0.013153229840099812,-0.6053677797317505,-0.8830723166465759,-0.3282298445701599,0.04535597935318947,-0.3373659551143646,-0.10036212205886841,0.3990471661090851,0.16590221226215363,0.48326316475868225,-0.16360649466514587,-0.8723576068878174,-0.11412788927555084,-0.3589072525501251,-0.30969732999801636,-0.4256232976913452,-0.16488170623779297,-0.13540080189704895,-0.0969131588935852,0.45565780997276306,-0.24651557207107544,0.2561255395412445,-0.23222248256206512,0.13715487718582153,-0.6185387969017029,0.3650120794773102,-0.5789327025413513,0.10967542976140976,0.4230239689350128,-0.6807516813278198,-0.8845629692077637,0.49191510677337646,-0.06297904253005981,0.39093947410583496,-0.6528347134590149,0.3718721568584442,-0.10907357931137085,0.49351030588150024,0.5439718961715698,-0.4493429362773895,0.007285983767360449,0.4972429871559143,-0.4997169077396393,-0.2825124263763428,-0.10827019065618515,0.2313394546508789,0.24618078768253326,-0.37457475066185,-0.07322805374860764,-0.29814109206199646,-0.010652984492480755,-0.17490431666374207,-0.29861047863960266