VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'Meningiomas exhibit considerable clinical and biological heterogeneity. We previously identified 4 distinct molecular groups ( Using an international cohort of 1698 meningiomas, we constructed and rigorously validated a machine learning-based molecular classifier using only DNA methylation data as input. Original and newly predicted molecular groups were compared using DNA methylation, RNA sequencing, copy number profiles, whole-exome sequencing, and clinical outcomes. We show that group-specific outcomes in the validation cohort are nearly identical to those originally described, with median progression-free survival (PFS) of 7.4 (4.9–Inf) years in  Our DNA methylation-based classifier, which is publicly available for immediate clinical use, recapitulates the biology and outcomes of the original molecular groups as assessed using multiple metrics/platforms that were not used in its training.', '{0.14283446967601776,0.38720521330833435,0.5257018208503723,-1.070427656173706,-0.4211878776550293,-0.8950204849243164,-0.6055988073348999,-0.8470407724380493,-0.3715039789676666,0.2774708569049835,-0.6384118795394897,0.05766119807958603,0.9100907444953918,0.596056342124939,-0.7524634599685669,0.6874803900718689,0.8371073603630066,-0.08061526715755463,-0.6670070290565491,0.32495421171188354,0.11498645693063736,-0.5776250958442688,0.15984846651554108,-0.316892147064209,-1.1598984003067017,-0.0934634655714035,0.21240505576133728,-0.19083043932914734,-0.2364911586046219,0.10956835746765137,-0.06117161363363266,-0.6544809341430664,0.501869797706604,-0.33667847514152527,-0.5583170652389526,0.15668343007564545,0.01003496628254652,-0.25695353746414185,0.014927640557289124,-0.2784312665462494,0.5626195669174194,-0.28394317626953125,0.2693961262702942,-0.21223485469818115,0.35335949063301086,0.15475238859653473,-0.5779107809066772,-0.2256326675415039,0.9325618743896484,-0.17816416919231415,-0.47964563965797424,-0