VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 3, 'basis of molecularly-informed clinical trials for meningioma. We make this tool publicly available. Meningioma, the most common primary intracranial tumor, We previously described 4 consensus molecular groups of meningioma by integrating DNA methylation, transcriptomic, and copy number alterations (CNAs) derived from whole-exome sequencing data To address this critical gap and translate the biologic insights of these novel molecular groups into clinical practice, we focused on adapting a multiplatform description of molecular classification into a more convenient single platform approach by building a classifier that predicts meningioma molecular group classification using only raw DNA methylation files as input. We used DNA methylation to anchor this classifier since CNAs can be inferred from these data, and because methylation-based classifiers have gained considerable traction in the clinical care of brain tumor patients.', '{0.16704805195331573,0.12437420338392258,0.4054356813430786,-1.0718549489974976,-0.17120839655399323,-0.8565061688423157,-0.4517950713634491,-0.7713485956192017,-0.3675539195537567,0.13516701757907867,-0.6061000227928162,0.3114734888076782,0.7926738858222961,0.63083416223526,-1.2407643795013428,0.44922584295272827,0.1633390635251999,0.1514357477426529,-0.7642478346824646,0.4380248486995697,0.18814179301261902,-0.6540791988372803,0.33909204602241516,-0.5604527592658997,-0.5717861652374268,-0.23656681180000305,0.25286242365837097,-0.03466300666332245,-0.5247384309768677,-0.021044395864009857,-0.1842954009771347,-0.5271678566932678,0.33200135827064514,-0.3945157825946808,-0.4257758557796478,0.0754682868719101,0.020796064287424088,-0.08599019050598145,0.000818958505988121,-0.2616652250289917,0.6241993308067322,0.19170133769512177,0.10741191357374191,-0.1657528281211853,0.3107284903526306,-0.0680539533495903,-0.44689521193504333,-0.14165829122066498,1.0496641397476196,0.003078